import React from "react";
import anime from 'animejs/lib/anime.es.js';

const Approach = () => {
const anime = require('animejs');

  anime({
    targets: 'div',
    translateX: 250,
    rotate: '1turn',
    backgroundColor: '#FFF',
    duration: 800
  });
  return (
    <div className='page'>
      <div className='container'>
        <div className='row'>
          <h3>This is the approach page</h3>
        </div>
      </div>
    </div>
  );
};

export default Approach;
